import React, { Component } from 'react';
import { Link } from 'react-router-dom';
 
import * as ROUTES from '../constants/routes';
 
const SignUpPage = () => (
  <div>
    <h1>SignUp</h1>
    <SignUpForm />
  </div>
);
 
const INITIAL_STATE = {
    username: '',
    email: '',
    passwordOne: '',
    passwordTwo: '',
    error: null,
  };
  
class SignUpForm extends Component {
